function Intro() {
  return (
    <div
      className="col-12 ms-2 "
      style={{
        height: "300px",
        boxShadow: "0px 0px 15px -2px 	#B0B0B0",
        borderRadius: "15px",
      }}
    >
           <img
                style={{
                  marginTop:"20px",
                  marginLeft:"20px",
                  color: "white",
                  background: "#707070",
                  borderRadius: "50%",
                  border: "2px solid #404040 ",
                  maxWidth: "230px",
                  maxHeight: "230px",
                }}
                alt=""
                src="images/profile.jpg"
              />
    </div>
  );
}
export default Intro;
